import React from 'react';
import { Grid, Paper } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
	grid: {
		width: '100%',
		margin: '0 auto'
	},
	paper: {
		padding: theme.spacing(1),
		textAlign: 'center'
	}
}));

export default function LoginForm () {
	// add in state later

	const classes = useStyles();

	return (
		<div className="LoginForm">
			This is My Login Form Component
			<Grid container spacing={2} className={classes.grid}>
				<Grid item xs={12} sm={12} md={8} lg={8} className="LoginForm-Wrapper">
					{/* actual form */}
					<Paper square className={classes.paper} elevation={5}>
						This is My Actual Form Component
					</Paper>
				</Grid>
				<Grid item xs={12} sm={12} md={4} lg={4} className="LoginFormInfo-Wrapper">
					<h3>Hello & Welcome</h3>
				</Grid>
			</Grid>
		</div>
	);
}
